// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

interface IERC20Token {
  function transfer(address, uint256) external returns (bool);
  function approve(address, uint256) external returns (bool);
  function transferFrom(address, address, uint256) external returns (bool);
  function totalSupply() external view returns (uint256);
  function balanceOf(address) external view returns (uint256);
  function allowance(address, address) external view returns (uint256);

  event Transfer(address indexed from, address indexed to, uint256 value);
  event Approval(address indexed owner, address indexed spender, uint256 value);
}

contract Wallet {
  //Variables
  address internal cUsdTokenAddress = 0x874069Fa1Eb16D44d622F2e0Ca25eeA172369bC1;

  address[] public owners;

  mapping(address => bool) public isOwner;

  uint public numConfirmationsRequired;

  address public walletAddr;

  uint public walletBalance;

  struct Transaction {
    address to;
    uint value;
    bytes data;
    bool executed;
    uint numConfirmations;
    mapping(address => bool) isConfirmed;
  }

  Transaction[] public transactions;

  //Events
  event Deposit(address indexed sender, uint amount, uint balance);
  event SubmitTransaction(
      address indexed owner,
      uint indexed txIndex,
      address indexed to,
      uint value,
      bytes data
  );
  event ConfirmTransaction(address indexed owner, uint indexed txIndex);
  event RevokeConfirmation(address indexed owner, uint indexed txIndex);
  event ExecuteTransaction(address indexed owner, uint indexed txIndex);


  //Modifiers
  modifier onlyOwner() {
    require(isOwner[msg.sender], "not owner");
    _;
  }

  modifier txExists(uint _txIndex) {
    require(_txIndex < transactions.length, "tx does not exist");
    _;
  }

  modifier notExecuted(uint _txIndex) {
    require(!transactions[_txIndex].executed, "tx already executed");
    _;
  }

  modifier notConfirmed(uint _txIndex) {
    require(!transactions[_txIndex].isConfirmed[msg.sender], "tx already confirmed");
    _;
  }

  //Constructor
  constructor(address[] memory _owners, uint _numConfirmationsRequired) {
    require(
      _numConfirmationsRequired > 0 && _numConfirmationsRequired <= _owners.length,
      "invalid number of required confirmations"
    );

    for (uint i = 0; i < _owners.length; i++) {
      address owner = _owners[i];

        require(owner != address(0), "invalid owner");
        require(!isOwner[owner], "owner not unique");

        isOwner[owner] = true;
        owners.push(owner);
    }

    numConfirmationsRequired = _numConfirmationsRequired;
    walletAddr = address(this);
  }

  //Functions
  function deposit(uint _amount) public payable {
    require(
      IERC20Token(cUsdTokenAddress).transferFrom(msg.sender, address(this), _amount),
        "Transfer failed"
    );

    emit Deposit(msg.sender, msg.value, address(this).balance);

  }

  function submitTransaction(address _to, uint _value, bytes memory _data)
    public
    onlyOwner
    {
      uint txIndex = transactions.length;
      transactions.push();
      Transaction storage _transaction = transactions[txIndex];
      _transaction.to = _to;
      _transaction.value = _value;
      _transaction.data = _data;
      _transaction.executed = false;
      _transaction.numConfirmations = 0;

      emit SubmitTransaction(msg.sender, txIndex, _to, _value, _data);
  }


  function confirmTransaction(uint _txIndex)
    public
    onlyOwner
    txExists(_txIndex)
    notExecuted(_txIndex)
    notConfirmed(_txIndex)
  {
    Transaction storage _transaction = transactions[_txIndex];

    _transaction.isConfirmed[msg.sender] = true;
    _transaction.numConfirmations += 1;

    emit ConfirmTransaction(msg.sender, _txIndex);
  }

  function executeTransaction(uint _txIndex)
    public
    onlyOwner
    txExists(_txIndex)
    notExecuted(_txIndex)
  {
    Transaction storage transaction = transactions[_txIndex];

    require(
      transaction.numConfirmations >= numConfirmationsRequired,
      "cannot execute tx"
    );

      transaction.executed = true;

      (bool success, ) = transaction.to.call{value:transaction.value}(transaction.data);
      require(success, "tx failed");

      emit ExecuteTransaction(msg.sender, _txIndex);
  }

  function revokeConfirmation(uint _txIndex)
        public
        onlyOwner
        txExists(_txIndex)
        notExecuted(_txIndex)
    {
        Transaction storage transaction = transactions[_txIndex];

        require(transaction.isConfirmed[msg.sender], "tx not confirmed");

        transaction.isConfirmed[msg.sender] = false;
        transaction.numConfirmations -= 1;

        emit RevokeConfirmation(msg.sender, _txIndex);
  }

  function getTransaction(uint _txIndex)
    public
    view
    returns (address to, uint value, bytes memory data, bool executed, uint numConfirmations)
    {
        Transaction storage transaction = transactions[_txIndex];

        return (
            transaction.to,
            transaction.value,
            transaction.data,
            transaction.executed,
            transaction.numConfirmations
        );

  }

  function getOwners() public view returns (address[] memory) {
    return owners;
  }

  function getTransactionCount() public view returns (uint) {
    return transactions.length;
  }

  function isConfirmed(uint _txIndex, address _owner)
    public
    view
    returns (bool)
  {
    Transaction storage transaction = transactions[_txIndex];

    return transaction.isConfirmed[_owner];
  }



}

contract WalletFactory{
  Wallet[] public wallets;

  mapping(address => uint) public ownerMaps;

  struct Transaction {
    address to;
    uint value;
    bytes data;
    bool executed;
    uint numConfirmations;
    mapping(address => bool) isConfirmed;
  }


  function setConfirmations(uint n) pure internal returns(uint){
    uint _numConfirmationsRequired;
    if(n == 1){
      _numConfirmationsRequired = 1;
    } else if( n > 1 && n < 5){
      _numConfirmationsRequired = 2;
    } else if( n >= 5){
      _numConfirmationsRequired = 3;
    }

    return(_numConfirmationsRequired);

  }

  function assignMap(address[] memory _owners, uint _id)internal{
    for (uint i = 0; i < _owners.length; i++) {
      address owner = _owners[i];
      ownerMaps[owner] = _id;
    }
  }

  //Functions
  function createNewWallet(address[] memory _owners) public {
    require(_owners.length > 0, "owners required");

    uint _numConfirmationsRequired = setConfirmations(_owners.length);

    Wallet _wallet = new Wallet(_owners, _numConfirmationsRequired);

    wallets.push(_wallet);

    uint walletId = wallets.length - 1;

    assignMap(_owners, walletId);
  }

  function deposit(uint _amount) public payable{
    uint _id = ownerMaps[msg.sender];
    Wallet _wallet = wallets[_id];
    _wallet.deposit(_amount);
  }

  function submitTransaction(address _to, uint _value, bytes memory _data)
    public
    {
      uint _id = ownerMaps[msg.sender];
      Wallet _wallet = wallets[_id];
      _wallet.submitTransaction(_to, _value, _data);
  }

  function confirmTransaction(uint _txIndex) public {
    uint _id = ownerMaps[msg.sender];
    Wallet _wallet = wallets[_id];
    _wallet.confirmTransaction(_txIndex);
  }

  function executeTransaction(uint _txIndex) public {
    uint _id = ownerMaps[msg.sender];
    Wallet _wallet = wallets[_id];
    _wallet.executeTransaction(_txIndex);
  }

  function revokeConfirmation(uint _txIndex) public {
    uint _id = ownerMaps[msg.sender];
    Wallet _wallet = wallets[_id];
    _wallet.revokeConfirmation(_txIndex);
  }


  function getTransaction(uint _txIndex)
      public
      view
      returns (address to, uint value, bytes memory data, bool executed, uint numConfirmations)
    {
      uint _id = ownerMaps[msg.sender];
      Wallet _wallet = wallets[_id];
      (to, value, data, executed, numConfirmations) = _wallet.getTransaction(_txIndex);
  }

  function getOwners() public view returns(address[] memory owners){
      uint _id = ownerMaps[msg.sender];
      Wallet _wallet = wallets[_id];

      owners = _wallet.getOwners();
  }

  function getTransactionCount() public view returns (uint txLength) {
    uint _id = ownerMaps[msg.sender];
    Wallet _wallet = wallets[_id];

    txLength = _wallet.getTransactionCount();
  }

  function checkConfirmation(uint _txIndex, address _owner) public view returns (bool isConfirmed){
    uint _id = ownerMaps[msg.sender];
    Wallet _wallet = wallets[_id];

    isConfirmed = _wallet.isConfirmed(_txIndex, _owner);
  }
}
